import React from 'react';
import ExpenseItem from '';
import './styles/style'
function ExpenseList({ expenses, onDeleteExpense }) {
  return (
    <div>
      <h2>Expense List</h2>
      <ul>
        {expenses.map((expense) => (
          <ExpenseItem
            key={expense.id}
            expense={expense}
            onDeleteExpense={onDeleteExpense}
          />
        ))}
      </ul>
    </div>
  );
}

export default ExpenseList;
